    false,nt"url": null,nt"notes": "The Toxics Release Inventory (TRI) Chemical
    Hazard Information Profiles (TRI-CHIP) dataset contains hazard information about
    the chemicals reported in TRI. Users can use this XML-format dataset to create their
    own databases and hazard analyses of TRI chemicals. The hazard information is compiled
    from a series of authoritative sources including the Integrated Risk Information
    System (IRIS). The dataset is provided as a downloadable .zip file that when extracted
    provides XML files and schemas for the hazard information tables.",nt"license_title":
